 !(function () {
  "use strict";
  tinymce.util.Tools.resolve("tinymce.PluginManager").add(
      "example",
      (e) => (
          ((e) => {
              e.addCommand("mceExampleEditor", () => {
                  ((e) => {
                      e.windowManager.open({
                        title: 'Example plugin',
                        body: {
                          type: 'panel',
                          items: [
                            {
                              type: 'input',
                              name: 'substituicao',
                              label: 'substituicao'
                            }
                          ]
                        },
                        buttons: [
                          {
                            type: 'cancel',
                            text: 'Close'
                          },
                          {
                            type: 'submit',
                            text: 'Save',
                            primary: true
                          }
                        ],
                        onSubmit: (o) => {
                          var data = o.getData();
                          /* Insert content when the window form is submitted */
                          e.insertContent("<font color=green><b><strike>" + "ENTITIE" + "</b></strike> " + data.substituicao + "</font>");
                          o.close();
                        },
                      });
                  })(e);
              });
          })(e),
          ((e) => {
              const o = () => e.execCommand("mceExampleEditor");
              e.ui.registry.addButton("example", { icon: "sourcecode", tooltip: "Source Exampole code", onAction: o }), e.ui.registry.addMenuItem("code", { icon: "sourcecode", text: "Source Example code", onAction: o });
          })(e),
          {}
      )
  );
})();
